import styled from "styled-components";

export const ContributionBox = styled.div`
  border: 1px gray solid;
  width: 100%;
  height: 10rem;
  display: flex;

  ul {
    position: relative;
    display: flex;
    flex-direction: column;
    height: 7rem;
    flex-wrap: wrap;
  }

  li {
    display: inline-block;
    width: 0.7rem;
    height: 0.7rem;
    margin: 1px;
    border: 0.2px solid black;
  }
`;
